— Imagine Dragons;
— Brainstorm;
— Игги Поп;
— The Neighborhood;
— Томми Джинезис;
— Apashe;
— Green Day;
— The Killers;
 — Franz Ferdinand.

Русские фанаты, идите на площади, а не на концерты!

СТРАНА УКРАИНА

❗️ Оперативная сводка от Генштаба:
- Темпы наступления снижены, у колонн бронетехники проблемы с обеспечением топливом и боеприпасами;
- Ракетные удары по Харькову и Чернигову - от невозможности зайти в города;
- Сумы, Лебедин и Охтырка остаются в окружении;
- Мариуполь: успеха у противника нет. К админграницам Донецкой и Луганской областей также не прошли;
- Херсон: противник вышел на рубеж Скадовска/Голой Пристани/Херсона/Новой Каховки, наступает на Николаев;
- Буча, Гостомель - мародерство и грабежи со стороны армии РФ;
- КИЕВ: противник сосредоточился на окружении города;
- РФ нарушает нормы Международного гуманитарного права.

СТРАНА УКРАИНА

Украина продолжает получать помощь от партнеров на Западе. Только за прошедшие сутки мы получили: 

⚡️ЕС – летальное оружие на сумму 450 млн евро; 

⚡️Норвегия – 230 млн долларов гуманитарной помощи; 

⚡️Италия – 110 млн евро;

⚡️Австралия – летальная военная помощь; 

⚡️Бельгия – 3 тысячи автоматических винтовок и 200 единиц противотанкового оружия; 

⚡️Германия – противотанковое оружие и 500 зенитных ракет Stinger; 

⚡️Чехия – оружие и техника на сумму 18 млн долларов;

⚡️Швеция – 5 тысяч единиц противотанкового оружия. 

Спасибо! Украина этого не забудет! 

СТРАНА УКРАИНА

Ситуация с мостами в Киеве:

- Патона и Дарницкий - перекрыты, проезд невозможен;
- Южный - проезд свободен, 1 блокпост;
- Северный - относительно свободен, 4 блокпоста.

Информация от нардепа от "СН" Юлии Гришиной

СТРАНА УКРАИНА

Главное на данный момент:

▪️у противника оперативная пауза, потому что они несут потери. В западной части Киева продолжается накопление количества противников, мы наносим по ним артиллерийский удар;
▪️Сумы полностью под контролем Украины. ВСУ и местные жители самоорганизовались  и держат оборону;
▪️Харьков держится и показывает блестящий результаты своей работы;
▪️Под Мариуполь отправляется тактическая группа РФ из Мелитополя. Наши знают про эту проблему и сейчас будут встречать там российские войска;
▪️Херсон держат наши силы и наносят потери врагу;
▪️Российские военные массово сдаются в плен.

СТРАНА УКРАИНА

Главное к этому часу:

- В Украине объявлена всеобщая мобилизация;
- Хакеры из Anonymous «объявили войну России». Сайты RT перестали работать;
- Президент Украины сообщил о 137 погибших. Среди них все пограничники с острова Змеиный, захваченного российскими военными;
- НАТО пообещало, что Россия «заплатит очень высокую экономическую и политическую цену»;
- Страны Европы и Япония начали приостанавливать выдачу виз россиянам;
- За сутки украинские военные уничтожили 30 танков, 130 бронированных машин, 5 самолётов и 6 вертолётов российской армии, заявил главнокомандующий ВСУ;
- В Минобороны РФ отчитались, что российские войска вывели из строя 83 наземных объекта украинской военной инфраструктуры, сбили 4 самолёта, четыре беспилотника «Байрактар» и вертолёт;

СТРАНА УКРАИНА
